create table sys_menu
(
    id                 varchar(32)                                           not null comment '菜单ID'
        primary key,
    name               varchar(32)                                           not null comment '菜单名称',
    type               char                                                  null comment '菜单类型 （0目录 1菜单 2按钮）',
    permission         varchar(32)                                           null comment '菜单权限标识',
    path               varchar(128)                                          null comment '前端URL',
    parent_id          varchar(32)                                           null comment '父菜单ID',
    parent_ids         varchar(2000)                                         null comment '父菜单IDs',
    icon               varchar(32)                                           null comment '图标',
    component          varchar(64)                                           null comment 'VUE页面',
    hidden             bit                      default b'0'                 null comment '隐藏',
    iframe             bit                      default b'0'                 null comment '是否外链',
    cache              bit                      default b'0'                 null comment '缓存',
    leaf               bit                      default b'0'                 null comment '1 叶子节点 0 非叶子节点',
    sort               int                      default 1                    null comment '排序值',
    created_by         varchar(50)                                           not null,
    created_date       timestamp(3)             default CURRENT_TIMESTAMP(3) null comment '创建时间',
    last_modified_by   varchar(50)                                           null,
    last_modified_date timestamp(3)                                          null on update CURRENT_TIMESTAMP(3) comment '更新时间',
    description        varchar(255)                                          null comment '描述',
    version            int                                                   not null,
    del_flag           char collate utf8mb4_bin default '0'                  null comment '0-正常，1-删除'
)
    comment '菜单权限表' charset = utf8;

